INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",26,"692,376,752,373,861,365,957,360,1044,354,1106,349,1109,369,884,381,787,392,693,397",null);
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",27,"7,29,32,30,80,26,112,27,144,25,179,22,217,23,242,21,268,21,304,22,330,19,363,17,399,16,419,18,439,17,475,17,507,17,532,15,552,17,567,17,573,18,576,11,568,6,560,3,460,5,349,6,227,12,140,17,81,17,41,20,16,18,6,24",'L?acte est établi en forme de chirographe : tête bêche, on reconnaît ou devine, comme la moitié supérieure d?un alphabet, par groupe de trois lettres, ABC, DEF, GHI, KLM, NOP. Ce type de « devise » (divisa, lettres ou dessin par lesquels passe la découpe du chirographe) est très courant. Il est d?ailleurs annoncé dans la corroboration de l?acte comme (carta) per alphabetum.(avant-dernière ligne).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",28,"92,48,98,57,92,64,89,57",'Curiosité paléographique : noter que, aux deux premières lignes, coexistent pas moins de quatre graphies du même mot, “quod” : qd, q barré, quod, Q°d.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",29,"173,26,177,32,175,41,169,38,169,31",'Curiosité paléographique : noter que, aux deux premières lignes, coexistent pas moins de quatre graphies du même mot, “quod” : qd, q barré, quod, Q°d.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",30,"369,31,384,27,381,21,370,20,361,20,351,22,353,30",'Seul la connaissance, par le moyen d?autres actes, de la titulature d?Amaury et des titulatures traditionnelles qu?il a reprises permet de développer les abréviations sévères dont use le scripteur.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",31,"457,46,465,40,461,35,457,34,452,35,448,39,450,43",'Curiosité paléographique : noter que, aux deux premières lignes, coexistent pas moins de quatre graphies du même mot, “quod” : qd, q barré, quod, Q°d.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",32,"492,28,497,20,491,18,488,24",'Noter que le nom du premier personnage désigné, Amaury, est écrit en entier la première fois ; pour le reste, ce sont deux “A” et un “B” qui prennent la parole, comme dans un problème de mathématique. Indifférence caractéristique au nom personnel face à l?expression des volontés, à l?immanence des fonctions, à l?autorité des sceaux.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",33,"568,38,573,34,563,30,560,38",'Curiosité paléographique : noter que, aux deux premières lignes, coexistent pas moins de quatre graphies du même mot, “quod” : qd, q barré, quod, Q°d.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",34,"402,151,411,157,408,162,401,160,398,157",'Abréviation caractéristique, à la chancellerie pontificale, du mot « tituli » entrant dans la titulature des cardinaux-prêtres.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man27.json","http://193.48.42.68/loris/adele/dossiers/27.jpg/full/full/0/default.jpg",35,"267,204,279,205,298,206,319,205,343,203,362,204,380,207,398,205,421,207,438,209,452,210,472,213,486,215,498,218,506,220,515,223,523,227,522,233,510,237,474,244,454,246,429,249,417,249,400,251,382,251,367,252,348,253,328,253,295,252,268,251,247,251,226,251,207,250,185,250,165,247,146,247,128,244,106,241,94,237,81,234,72,229,78,222,95,216,139,211,158,207",'L?acte a été scellé du sceau de chacun des trois intervenants, comme il est annoncé dans la corroboration. Les trois sceaux sont perdus, et l?on ne voit plus que les fentes pratiquées dans le repli de l?acte pour accueillir les doubles queues de parchemin supportant les sceaux. La curieuse superposition des fentes, deux à deux, est un effet créé par le dessinateur de la lithographie pour suggérer la présence de deux incisions, l?une sur le repli, l?autre sous le repli, qu?il a tenté de montrer en perspective.');
