INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",27,"145,358,267,372",null);
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",28,"273,374,444,434",null);
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",29,"167,411,479,432",'Caractéristique qu?il faudrait examiner sur l?original : le trait occupe un espace blanc que, sans doute, le nom de « Hugues de Verdun » n?a pas réussi à couvrir suffisamment, pour avoir été porté dans un second temps. Cette pratique du « blanc » est courante dans les actes royaux de la seconde moitié du XVe siècle : elle permet de préparer un acte d?administration courante avant même que tous les éléments en soient décidés.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",30,"215,441,268,495",'Comme dans l?acte royal français, le « S » initial de la clause injonctive est grossi.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",31,"226,12,232,19,232,26,234,30,233,34,231,43,226,45,221,40,219,34,219,27,221,18",'Étirement vers le haut des deux points qui servent à pointer le « y ».');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",32,"354,23,364,25,369,29,373,35,375,41,370,47,363,51,358,56,352,52,345,49,339,41,340,37,342,29,347,27",'Héritier indirect des lettres allongées du haut Moyen Âge, pourtant appliqué ici à un acte modeste, noter l?étirement en hauteur de la plupart des initiales de la première ligne.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",33,"475,25,483,34,486,46,488,58,488,71,488,83,488,97,487,108,486,118,483,124,480,131,479,136,476,138,469,131,467,121,464,112,462,103,461,91,460,73,463,58,464,43,468,34",'La large marge laissée à gauche n?a guère de répondant à droite, où la marge est plus étroite, sans souci de justification ; aucun mot n?est coupé');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",34,"206,84,212,87,213,92,206,92,202,89",'Caractéristique qu?il faudrait examiner sur l?original : le trait occupe un espace blanc que, sans doute, le nom de « Hugues de Verdun » n?a pas réussi à couvrir suffisamment, pour avoir été porté dans un second temps. Cette pratique du « blanc » est courante dans les actes royaux de la seconde moitié du XVe siècle : elle permet de préparer un acte d?administration courante avant même que tous les éléments en soient décidés.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",35,"103,96,114,97,115,105,108,108,101,108,96,106,90,101,92,97,97,97",'Comme dans l?acte royal français, le « S » initial de la clause injonctive est grossi.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",36,"351,156,373,164,381,177,387,191,386,204,384,217,380,227,374,236,365,244,360,244,349,247,341,244,327,232,321,224,316,212,316,202,316,190,322,176,328,167,333,162,340,159,344,156,360,158",'Fragment de la simple queue de parchemin, portant la trace du sceau.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",37,"190,145,202,153,207,156,210,163,211,172,213,182,210,190,205,198,201,204,193,207,185,207,179,200,172,190,170,179,170,170,172,162,177,154,182,145",'Paraphe concluant la signature du nom du notaire-secrétaire. Sa forme est à rapprocher des formes pratiquées en chancellerie royale à l?époque.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",38,"44,237,51,239,56,246,54,252,50,258,43,257,36,253,34,247,38,241",'Trace de déchirure de la bandelette de parchemin qui, découpée sous la simple queue, permettait de clore le document tout en protégeant le sceau, sur lequel le parchemin plié était rabattu puis “ficelé”.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man31.json","http://193.48.42.68/loris/adele/dossiers/31.jpg/full/full/0/default.jpg",39,"387,118,399,119,411,123,414,127,405,129,398,129,393,129,388,129,383,125,408,120,392,120,391,119,386,123",'Le quantième et le mois semblent eux aussi avoir été portés dans un second temps. On peut très bien imaginer la présente lettre de commission préparée sitôt « l?accord et traité » du 25 mai conclu, puis complétée le lendemain, où l?on a désigné un commissaire disponible.');
