INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",25,"379,61,14",'Capitale à redoublement, fréquente aussi dans les écritures de la chancellerie royale au même moment. Noter que cet ornement distingue surtout des noms propres et des noms de fonction, comme certains chiffres');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",26,"586,50,611,103",'Deux signes abréviatifs différents (l’usage est confirmé dans le reste du texte) après la lettre "r" ; le premier est en fait spécifique à l’abréviation de "-orum" (voir aussi "armorum" 1.3). Pour le reste, l’usage des abréviations est relativement discret');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",27,"138,76,11",'Signe de ponctuation mineur (trait oblique court et fin), qui, entre autres, sert à ouvrir des incises ou à isoler, comme ici, les chiffres des milliers et des centaines, plus bas les livres et les sous');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",28,"582,147,580,167,582,215,598,227,609,214,610,174,609,149,595,134",'Justification droite parfois incertaine : mais noter que, comme dans l’acte royal, le scripteur ne coupe aucun mot en fin de ligne');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",29,"65,313,80,304,148,299,206,300,250,310,246,319,198,327,90,325",'Clôture du texte par un signe et trois longs traits, qui n’occupent pas toute la ligne finale');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man38.json","http://193.48.42.68/loris/adele/dossiers/38.jpg/full/full/0/default.jpg",30,"239,384,276,385,290,357,280,333,256,324,230,335,223,363",'Simple queue de parchemin, sceau disparu');
