INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",30,"129,43,147,81",'Ornementation discrète de quelques lettres à la première ligne');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",31,"299,35,324,74",'Ornementation discrète de quelques lettres à la première ligne.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",32,"663,115,19",'Pas de justification du texte à droite ; au besoin, quelques mots sont coupés (sans trait d’union)');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",33,"341,325,351,310,387,300,428,300,460,312,469,327,451,344,411,352,357,343",'Le signe précédant le nom "Ar. Vionni" (dont la graphie est identique à celle du texte, et n’a aucune caractéristique de signature) est à peine une ébauche de seing manuel ; il s’apparente plutôt aux mentions d’attestation ou de prise de responsabilité du rédacteur de l’acte, que l’on trouve en certaines zones, du genre "Notavi", "Nota Talis", "Ita est"... Il est possible de l’interpréter comme la combinaison d’un pied de mouche et d’un "i" suivi d’un signe abréviatif, peut-être pour "Ita [est]"');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",34,"592,323,605,312,632,309,661,310,687,320,682,332,645,337,606,334",'Groupes de traits et de signes ondulés occupant la fin de la dernière ligne, à effet esthétique et dissuadant les interpolations');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man39.json","http://193.48.42.68/loris/adele/dossiers/39.jpg/full/full/0/default.jpg",35,"120,408,126,392,145,383,171,386,187,401,186,420,164,430,137,429,124,417",'Double queue de parchemin. Le lithographe a très vraisemblablement omis de reproduire, plus vers la droite, la fente par laquelle devait passer l’attache, symétrique, du second sceau de l’acte');
