INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",33,"67,50,10",'Trait (issu de deux points écrits cursivement) signalant l’ouverture de l’acte');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",34,"10,144,2,167,13,196,30,193,35,167,27,145",'Tortil de parchemin qui passe dans l’acte, et l’"attache" à l’acte royal visé');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",35,"63,138,84,156,87,194,62,219,36,196,38,153",'Signet (ici disparu) apposé sur un substrat de cire en croix ; couvrant le tortil, il authentifie l’attache. C’est traditionnellement le signet du plus haut en grade ou ancienneté des auteurs de la lettre');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",36,"321,305,20",'Parmi les signets des autres auteurs de l’acte requis pour le scellement (ici en tout six parmi tous les gens des comptes et généraux), signet directement plaqué sur le support');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",37,"441,306,38",'"Signet plaqué sur une croix en cire, censée renforcer l’adhérence au support');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man40.json","http://193.48.42.68/loris/adele/dossiers/40.jpg/full/full/0/default.jpg",38,"516,292,36",'Signature du responsable de la mise par écrit. Comme au bas des actes royaux, cette signature est une mention hors-teneur de nature interne ; elle ne confère aucune authenticité. À terme, dès le XVIe siècle, elle gagnera la qualité de signe de validation');
