INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",29,"19,6,10,18,6,41,11,68,18,82,26,69,27,45,25,20",'Seule l’initiale du nom pontifical est grossie.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",30,"229,60,12",'Tilde plat.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",31,"562,146,14",'Le texte est à peu près justifié à droite, au besoin par étirement de lettres (l. 2, 4, 10, 11) ou d’un signe de ponctuation (l. 8) ; aucun mot n’est ici coupé en fin de ligne (mais la pratique est admise).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",32,"141,201,10",'Mise en valeur discrète de l’initiale de l’exposé.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",33,"255,284,8",'Absence d’allongement de la ligature c-t.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man45.json","http://193.48.42.68/loris/adele/dossiers/45.jpg/full/full/0/default.jpg",34,"320,389,350,376,429,373,534,377,578,388,540,400,457,403,359,401",'La date suit, aux deux dernières lignes, une disposition très rigoureuse ; les mots sont séparés par de grands blancs d’abord parce que les coupures autorisées entre les différents éléments de la date sont rares, ensuite parce que la dernière ligne d’écriture doit être entièrement occupée.');
