INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",28,"24,33,23",'Initiale agrandie et noircie.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",29,"184,42,8",'Initiale à trait redoublé (utilisée pour plusieurs noms de terres, titres, noms d’officiers et ouvertures de parties du discours).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",30,"513,35,15",'Initiale élevée.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",31,"122,158,153,145,241,146,271,158,244,171,145,170",'L’écriture ne suit qu’imparfaitement l’alignement et, d’abord trop lâche, se tasse brusquement : il est évident que le nom a été ajouté en chancellerie dans un second temps, sur un espace laissé blanc. L’examen des formes permet d’y discerner l’intervention d’une autre main, plus archaïque, ne pratiquant pas l’écriture mixte.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",32,"684,182,694,170,726,169,736,184,725,199,685,196",'Le dernier mot de la date et par là même de l’acte, suivi d’un signe de ponctuation marquant la clôture du texte, est inscrit en fin de ligne, après un long espace blanc.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man47.json","http://193.48.42.68/loris/adele/dossiers/47.jpg/full/full/0/default.jpg",33,"30,271,47,313,185,355,344,355,439,333,495,284,469,245,397,216,281,202,148,211,66,239",'Simple queue de parchemin. On distingue la trace laissée par le grand sceau rond du roi et l’épaisseur d’une pliure double, contractée après la disparition du sceau.');
