INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",51,"229,30,17",'Lettres conjointes : un élément commun au “t” et au “r”.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",52,"197,57,257,74",'Lettres capitales.');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",53,"351,154,13",'Contrairement à ses usages postérieurs, la chancellerie n?interdit pas encore les coupures de mots en fin de ligne. Les coupures sont inégalement signalées par un trait d?union (2 cas contre 4).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",54,"57,231,18",'Ligature “-st-” allongée (trait d?influence pontificale).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",55,"68,381,11",'Point virgule de clôture du discours (alterne avec le point, avec une valeur apparemment renforcée).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man53.json","http://193.48.42.68/loris/adele/dossiers/53.jpg/full/full/0/default.jpg",56,"233,655,77",'Monogramme, très proche de celui de Louis VI et, plus loin, de celui de Louis le Pieux. La structure porteuse, en forme de H, impose de lire le nom à l?ancienne, “Hludovicus”.');
