INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man67.json","http://193.48.42.68/loris/adele/dossiers/67.jpg/full/full/0/default.jpg",33,"313,335,48",'Seings manuels des tabellions : la proximité de l’écriture suggère que c’est Bouton qui a mis l’acte au net. Noter la divergence des paraphes qui ornent et complètent le patronyme dans le seing, et la présence insistante dans l’un et l’autre de dessins rappelant la lettre <hi rend="i">n</hi> (pour <hi rend="i">nota</hi>, <hi rend="i">notavi</hi>, <hi rend="i">notarius</hi>… ?).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man67.json","http://193.48.42.68/loris/adele/dossiers/67.jpg/full/full/0/default.jpg",34,"358,308,382,304,415,307,413,317,388,320,362,320,353,310,358,309",'Fente pour le scellement ?');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man67.json","http://193.48.42.68/loris/adele/dossiers/67.jpg/full/full/0/default.jpg",35,"488,283,545,290,577,308,573,340,530,360,492,359,441,354,418,329,429,301,461,288",'Seings manuels des tabellions : la proximité de l’écriture suggère que c’est Bouton qui a mis l’acte au net. Noter la divergence des paraphes qui ornent et complètent le patronyme dans le seing, et la présence insistante dans l’un et l’autre de dessins rappelant la lettre <hi rend="i">n</hi> (pour <hi rend="i">nota</hi>, <hi rend="i">notavi</hi>, <hi rend="i">notarius</hi>… ?).');
INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man67.json","http://193.48.42.68/loris/adele/dossiers/67.jpg/full/full/0/default.jpg",36,"523,183,543,195,526,210,512,205,506,193,519,183",'Un passage blanc (sans doute après grattage) est occupé par un trait destiné à empêcher toute addition frauduleuse.');
