INSERT INTO image_zone (manifest_url,img_id,zone_id,coords,note) VALUES ("http://193.48.42.68/adele/iiif/manifests/man95.json","http://193.48.42.68/loris/adele/dossiers/95.jpg/full/full/0/default.jpg",54,"41,82,32",'La lettre initiale du texte (« d ») est mise en attente dans une colonne spéciale ; ces indications sont destinées à un enlumineur ou rubricateur, qui n’a jamais passé son pinceau…');
